/* How to set .conditions tags for a track, which regulate when it can be played:
  💥 The content of tracklist[i].conditions is an array. Example of evaluation of a .conditions element:
      [[{tag1:val1}],[{tag2:val2, tag3:val3}]] evaluates true when (tag1) || (tag2 && tag3). In other words,
      the top level array has elements evaluated with OR, and its elements are themselves arrays evaluated by AND.
  💥 Tags work as follows:
    (key)       (val)   (description, evaluates as true when:)
    ——————————————————————————————————————————————————————————————————————————
    turn>:      int     current turn number in the game is greater than val
    turn<:      int     current turn number in the game is less than val
    tech        string  player has tech
    gov         string  player is gov
    wonderplr,  string  player has wonder
    wonderwld,  string  world (is known to) possess wonder
    civ         string  val == style_string for player's nation (see "const styles = [...]" directly above)
    modality    string  will obey hard-coded rules for what kind of music to play. requires change_modality() to be called to
                           set the global music_modality var and reconstruct the filtered_tracklist[].
                                                | track modality ⮕
                           ⬇ music_modality ⬇  | normal  battle   battle only    !peaceful   war&peace
                           normal   -               ✅      ✅          ❌             ✅         ✅
                           battle   -               ❌      ✅          ✅             ❌         ✅
                           peaceful -               ✅      ❌          ❌             ❌         ✅
                           all      -               ✅      ✅          ✅             ✅         ✅
                           ------------------------------------------------------
                           So to use this tag, put in a track modality above (modality undefined=="normal"), and
                           it will play or not play according to music_modality, as shown above.
    priority    string  (val == "priority") makes this track first priority; i.e., queued first when it becomes legal
                        ❗️NB: needs other operand(s): does NOT reckon the legality of the track; by itself renders false,
                        this is not a logic tag but a priority tag. To make such track true, include *❗️*SEPARATE*❗️* operands
                        e.g. (P) || (O1) || (O2). (P)riority simply tags but makes its operand false. (O1),(O2) will evaluate legality.
                        (Can't do a track with only (P) or only one operand with (P && ..), as it would always evaluate false.)
                        💥Be careful with making a song always queue first because playlist may reset and overplay the song:
                           take extra care to make priority tracks expire soon after their context is fulfilled.

    "!" prefixed to a key name serves at NOT: e.g. {"!gov":"Despotism"} evaluates as (gov != Despotism) */
/*—————————————————*/
